import React from 'react';
import { Route} from 'react-router-dom';

import Main from './components/Main';
import AddPhoto from  './components/AddPhoto';


function App() {
  return (
    <div className="App">
        <Route exact path = '/' component = { Main } />
        <Route path component = {AddPhoto} />
    </div>
  );
}

export default App;
